import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./VIEW/home"
import Login from "./VIEW/login"

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home/>}></Route>
        <Route path="/login" element = {<Login/>}></Route>
      </Routes>
    </BrowserRouter>

  );
}
export default App;
